import React from 'react';
import CartItems from '../components/CartItems';
import CartTotal from '../components/CartTotal';

const CartPage = () => {
  return (
    // Outer container to center everything on the screen
    <div className="flex justify-center w-full">
      // Wrapper container with max-width and horizontal auto margins
      <div className="flex flex-col md:flex-row items-start max-w-screen-xl mx-auto">
        <CartItems />
        <CartTotal />
      </div>
    </div>
  );
}

export default CartPage;
